import {request} from "../base/HTTP";
import HttpMethod from "../constants/HttpMethod";

export async function getDoctorTypes(data) {
    return await request('/api/doctor-types/all', data);
}

export async function addDoctorType(data) {
    return await request('/api/doctor-types', data, HttpMethod.POST);
}

export async function deleteDoctorType(id) {
    return await request('/api/doctor-types/' + id, {} , HttpMethod.DELETE);
}
